/**
 * @param  {BufferGeometry} geometry
 * @param  {GLTF.Primitive} primitiveDef
 * @param  {Array<BufferAttribute>} accessors
 */
const addPrimitiveAttributes = (geometry, primitiveDef, accessors) => {
  var attributes = primitiveDef.attributes

  for (let gltfAttributeName in attributes) {
    const threeAttributeName = ATTRIBUTES[gltfAttributeName]
    const bufferAttribute = accessors[attributes[gltfAttributeName]]

    // Skip attributes already provided by e.g. Draco extension.
    if (!threeAttributeName) continue
    if (threeAttributeName in geometry.attributes) continue
    geometry.addAttribute(threeAttributeName, bufferAttribute)
  }

  if (primitiveDef.indices !== undefined && !geometry.index) {
    geometry.setIndex(accessors[primitiveDef.indices])
  }
}

/**
 * Specification: https://github.com/KhronosGroup/glTF/blob/master/specification/2.0/README.md#geometry
 * @param {Array<Object>} primitives
